DROP TABLE IF EXISTS `dim_game`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `dim_game` (
  `game_key` int NOT NULL AUTO_INCREMENT,
  `game_id` int NOT NULL,
  `title` varchar(255) NOT NULL,
  `bgg_url` varchar(500) NOT NULL,
  `year_published` smallint DEFAULT NULL,
  `min_players` tinyint unsigned DEFAULT NULL,
  `max_players` tinyint unsigned DEFAULT NULL,
  `min_playtime` smallint unsigned DEFAULT NULL,
  `max_playtime` smallint unsigned DEFAULT NULL,
  `min_age` tinyint unsigned DEFAULT NULL,
  `complexity_rating` decimal(3,2) DEFAULT NULL,
  `effective_date` date NOT NULL,
  `expiry_date` date DEFAULT NULL,
  `is_current` tinyint(1) NOT NULL DEFAULT '1',
  `record_source` varchar(50) NOT NULL DEFAULT 'operational_db',
  `complexity_category` enum('Light','Medium-Light','Medium','Medium-Heavy','Heavy') GENERATED ALWAYS AS ((case when (`complexity_rating` < 1.5) then _utf8mb3'Light' when (`complexity_rating` < 2.5) then _utf8mb3'Medium-Light' when (`complexity_rating` < 3.5) then _utf8mb3'Medium' when (`complexity_rating` < 4.5) then _utf8mb3'Medium-Heavy' else _utf8mb3'Heavy' end)) STORED,
  `player_range` enum('Solo','2-Player','Small Group','Large Group','Party') GENERATED ALWAYS AS ((case when (`max_players` = 1) then _utf8mb3'Solo' when (`max_players` = 2) then _utf8mb3'2-Player' when (`max_players` <= 4) then _utf8mb3'Small Group' when (`max_players` <= 8) then _utf8mb3'Large Group' else _utf8mb3'Party' end)) STORED,
  `playtime_category` enum('Quick','Short','Medium','Long','Epic') GENERATED ALWAYS AS ((case when (`max_playtime` <= 30) then _utf8mb3'Quick' when (`max_playtime` <= 60) then _utf8mb3'Short' when (`max_playtime` <= 120) then _utf8mb3'Medium' when (`max_playtime` <= 240) then _utf8mb3'Long' else _utf8mb3'Epic' end)) STORED,
  PRIMARY KEY (`game_key`),
  KEY `idx_game_id` (`game_id`),
  KEY `idx_current` (`is_current`),
  KEY `idx_year_published` (`year_published`),
  KEY `idx_complexity` (`complexity_rating`),
  KEY `idx_title` (`title`),
