--
-- Table structure for table `fact_game_rankings`
--

DROP TABLE IF EXISTS `fact_game_rankings`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `fact_game_rankings` (
  `ranking_key` bigint NOT NULL AUTO_INCREMENT,
  `game_key` int NOT NULL,
  `time_key` int NOT NULL,
  `rank_position` int NOT NULL,
  `previous_rank` int DEFAULT NULL,
  `rank_change` int GENERATED ALWAYS AS ((`previous_rank` - `rank_position`)) STORED,
  `rank_trend` enum('Rising','Falling','Stable','New Entry') GENERATED ALWAYS AS ((case when (`previous_rank` is null) then _utf8mb3'New Entry' when ((`previous_rank` - `rank_position`) > 0) then _utf8mb3'Rising' when ((`previous_rank` - `rank_position`) < 0) then _utf8mb3'Falling' else _utf8mb3'Stable' end)) STORED,
  `geek_rating` decimal(4,3) DEFAULT NULL,
  `rating_change` decimal(4,3) DEFAULT NULL,
  `batch_id` int NOT NULL,
  `load_timestamp` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`ranking_key`),
  UNIQUE KEY `uk_game_time` (`game_key`,`time_key`),
  KEY `idx_rank_position` (`rank_position`),
  KEY `idx_time` (`time_key`),
  KEY `idx_trend` (`rank_trend`),
  KEY `idx_fact_rankings_composite` (`time_key`,`rank_position`,`rank_trend`),
  CONSTRAINT `fact_game_rankings_ibfk_1` FOREIGN KEY (`game_key`) REFERENCES `dim_game` (`game_key`),
  CONSTRAINT `fact_game_rankings_ibfk_2` FOREIGN KEY (`time_key`) REFERENCES `dim_time` (`time_key`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

